                        substr = substr.trim();
                        if (IsPassive()) return "PASV\r\nLIST " + substr + "\r\n"; else return "PORT " + GetSelfIP() + GetSelfPort() + "\r\nLIST " + substr + "\r\n";
                }
            }
        case 3:
            {
                switch(CountArgs(tmp)) {
