                }
                return null;
            }
        case 11:
            {
                if (GetStatus() != 2) throw new XylFTPException("pwd", "You can't execute it now. Try again later.");
                switch(CountArgs(tmp)) {
                    case 1:
                        return "PWD\r\n";
