                }
                return null;
            }
        case 13:
            {
                switch(CountArgs(tmp)) {
                    case 2:
                        String[] cmds = tmp.split("[\t ]+");
                        if (!cmds[1].equals("on") && !cmds[1].equals("off")) throw new XylFTPException("passive", "Wrong arugment."); else {
