                    if (index >= 0) line = line.substring(0, index);
                    writer(out, nscripterMap.addLabel(currentFilename, line));
                    continue;
                }
                if (line.startsWith("@")) {
                    String command = transform(line.substring(1));
                    if (command != null) {
                        writer(out, command);
                    }
                    continue;
                }
                Matcher matcher = pattern.matcher(line);
                StringBuilder sb = new StringBuilder();
                int index = 0;
                while (matcher.find()) {
                    String temp = line.substring(index, matcher.start());
                    if (replacePattern.matcher(temp).matches()) {
                        for (int j = 0; j < temp.length(); j++) {
                            char c = temp.charAt(j);
                            switch(c) {
                                case '/':
                                    sb.append('');
                                    break;
                                case '\\':
                                    sb.append('');
                                    break;
                                case '_':
                                    sb.append('');
                                    break;
                                case '@':
                                    sb.append('');
                                    break;
                                default:
                                    sb.append(c);
                                    break;
                            }
                        }
                    } else {
                        sb.append(temp);
                    }
                    index = matcher.end();
                    String command = transform(matcher.group(1));
                    if (command == null) command = "";
                    sb.append(command);
                }
                sb.append(line.substring(index, line.length()));
                if (sb.length() > 0) {
                    writer(out, sb.toString());
                }
            }
        } catch (Exception e) {
            e.printStackTrace();
        } finally {
            if (in != null) try {
                in.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
            if (out != null) try {
                out.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
        }
        t++;
    }
    if (!ifMap.isEmpty()) {
        BufferedWriter out = null;
