            conn.commit();
        } else conn.rollback();
    } catch (Exception e) {
        System.out.println("Error Happens when trying to obtain the senquence number");
        e.printStackTrace();
    } finally {
        try {
            if (conn != null) conn.close();
            if (rs != null) rs.close();
            if (ps != null) ps.close();
        } catch (SQLException se) {
            se.printStackTrace();
        }
    }
    return result;
