        for (int i = 0; i < pos.length; i++) {
            pos[i] = i;
        }
        boolean swapped = true;
        while (swapped) {
            swapped = false;
            for (int i = 0; i < pos.length - 1; i++) {
                if (rowObject[pos[i]].getWeight() > rowObject[pos[i + 1]].getWeight()) {
                    int temp = pos[i];
                    pos[i] = pos[i + 1];
                    pos[i + 1] = temp;
                    swapped = true;
