                        s = matcher.start();
                        e = matcher.end();
                    } else {
                        break;
                    }
                } while (matcher.find());
            }
            if (s == -1 && loopSearch) {
                if (matcher.find(startPos)) {
                    do {
                        s = matcher.start();
                        e = matcher.end();
                    } while (matcher.find());
                }
            }
