        DigestInputStream shaStream = new DigestInputStream(md5Stream, digestSHA);
        CRC32 crc32 = new CRC32();
        byte[] data = new byte[1024 * 2];
        int byteCount;
        while ((byteCount = shaStream.read(data)) > -1) {
            crc32.update(data, 0, byteCount);
        }
        crc = crc32.getValue();
        crc32.reset();
