    List<int[]> beginEnds = new ArrayList<int[]>();
    String regexp = "";
    if (fuzzy) {
        String[] termArray = term.split("\\s+");
        for (String termElement : termArray) {
            if (!regexp.isEmpty()) {
                regexp += "[\\W|_]*";
            }
            regexp += Pattern.quote(termElement);
        }
    } else {
        regexp = Pattern.quote(term);
