        dist[i][j] = Math.pow((discre[j] + discre[j + 1]) / 2 - (discre[i] + discre[i + 1]) / 2, 2) + Math.pow((discre[j + 1] - discre[j]) / 2 - (discre[i + 1] - discre[i]) / 2, 2);
